(416, 'Austin Innovators Network', 'If you''re in Austin, chances are-- you''re an innovator, which is perfect because this group is for Austin innovators who want to meet with other professionals interested in mobile innovations and technologies. But our innovation doesn''t stop there: we want to leap over boundaries when it comes to discussion topics, speakers, and activities. Let''s meet once a month on the 3rd Thursday and keep it just like our city: fun, innovative and forward thinking.'),
