(559, 'Beer Bandolier', '<p>The beer bandolier is the ultimate buddy gadget. Whether at a tailgate party before the big game or watching your son''s junior baseball team, the beer bandolier ensures you will be the center of any party.</p>'),
(620, 'Do Groups and Projects get lumped into the same collection?', '<p>Testing to see how groups are handled when created. Do they go in a seperate group (Home Page, upper right)</p>'),
