(1347, 'The “connected world” will increase by roughly 3 billion people, or 50% between 2011 and 2015. Many of the new comers come from the 80% of the global population that exists on less than $10 a day and an astonishing 2.56 billion who subside on less...'),
(1348, 'new_post'),
(1349, 'The “connected world” will increase by roughly 3 billion people, or 50% between 2011 and 2015. Many of the new comers come from the 80% of the global population that exists on less than $10 a day and an astonishing 2.56 billion who subside on less than $2 a day. \r\n\r\nMobile connectivity is a leapfrog technology that allows developing nations to bypass significant infrastructure build in favor of a less expensive mobile alternative. \r\n\r\nAffordable mobile devices benefit from cloud-based and downloadable applications which reduce device requirements,  enabling low-cost devices to access remotely hosted and tailored resources. \r\n\r\nMobile leapfrog technologies connect the world and provide a platform of opportunity for information, education, employment and upward mobility. \r\n\r\nNet result: We are in the early stages of a transformative period which greatly expands the globally connected network and enlarges both opportunity and talent pools.'),
