(1355, 'The freelance employment market will exceed $1 billion dollars in transactions this year'),
(1356, 'The global labor market is changing. When available, companies are pursuing  flexible employment strategies and increasingly relying on outsourced and freelance employment.  \r\n\r\nThe freelance employment market will exceed $1 billion dollars in transactions this year and will exhibit high double digit growth rates for the foreseeable future. \r\n\r\nFreelancing is an attractive option for not only people who reside in the developing markets, but a growing number of contingent workers from developed economies are attracted to freelance work as a means of supplementing their income.   \r\n\r\nAs the freelance market expands and deepens, it is capturing a broader distribution of industries and expertise. \r\n\r\nIn short: The global contingent labor market is a growing pool of talent that embodies an entrepreneurial ethos and culture and is  acclimated to opportunity discovery, cross cultural collaboration, remote work and an awareness of available online tools and resources.'),
(1357, 'freelance labor'),
(1358, '1 billion'),
(1359, 'global labor'),
(1360, 'start up costs,'),
(1361, 'There is a growing effort of governments and Institutions to support innovation and entrepreneurship. Universities and colleges wish to commercialize their IP and state and local governments wish to support new company formation to provide jobs and increased economic activity.  This is particularly true during the current state of the economy and in an environment of shrinking government assistance. \r\n\r\nCloud computing, open source software, freelance  labor, agile software development methodologies and lean startup principles have all worked to increase the speed of startup development while simultaneously reducing waste and capital requirement to develop and launch an idea. \r\n\r\nHistorically, greater levels of experimentation, innovative technology development and company formation  have been negatively correlated to financial cost. As costs decline we expect to see greater participation and more activity in these areas. In an environment where technologies are commoditized and resources are plentiful, the financial costs associated  participation will continue to decline toward zero while the number of participants starting new companies, developing technologies or experimenting with ideas increases dramatically.'),
