(1394, 'Directions:\r\n\r\n1\r\nIn a large bowl, mix flour, oat bran, wheat germ, baking powder and sugar.\r\n2\r\nIn a measuring cup, mix milk, egg, oil and vanilla.\r\n3\r\nStir milk mixture into flour mixture.\r\n4\r\nMix well.\r\n5\r\n(At this point, batter can be prepared and refrigerated for up to 12 hours. Thin batter by adding milk to desired consistency.) To cook, spray skillet with nonstick spray and heat to medium.\r\n6\r\nAdd 1-2 tablespoons batter per pancake.\r\n7\r\nCook over medium heat until brown, about 1 minute.\r\n8\r\nTurn and cook until brown, about 1 minute longer.\r\n9\r\nServe with syrup, jelly, apple butter, etc.\r\n\r\nRead more at: http://www.food.com/recipe/oat-and-wheat-germ-pancakes-94874?oc=linkback'),
(1395, 'Michael, \r\n\r\nSpeaking directly to your larger point, Vivek Wadhwa, Annalee Saxenian and others have documented in an interesting trend that may suggest a more complicated dynamic. If I can summarize one compelling aspect of the Wadhwa’s (et al)...'),
(1396, 'Michael, \r\n\r\nSpeaking directly to your larger point, Vivek Wadhwa, Annalee Saxenian and others have documented in an interesting trend that may suggest a more complicated dynamic. If I can summarize one compelling aspect of the Wadhwa’s (et al) research, a growing number of foreign born nationals that have attended US schools and are employed in the US are deciding to return to their native countries. One of the most highly cited reasons is a greater sense of opportunity in their country of origin. Moreover, of those returning, something like 52% plan to start a business within 5 years. \r\n\r\nThe most interesting question, it seems to me, is this perception of relative value arbitrage. I briefly explored this question with Vivek. Specifically, what is the distribution of returnees based on education, employment compensation? Is there a perception of a glass ceiling or some other dynamic at work?  As of yet, the data is inconclusive to this question. \r\n\r\nI suspect that, at least part of the answer can be found with something you hinted at; Silicon Valley now competes for talent across a much more challenging fitness landscape. If accurate, this view may suggest different (more difficult) policy implications than liberalizing immigration to attract and retain talent. \r\n\r\nKin'),
(1397, 'Michael, \r\n\r\nSpeaking directly to your larger point, Vivek Wadhwa, Annalee Saxenian and others have documented in an interesting trend that may suggest a more complicated dynamic. If I can summarize one compelling aspect of the Wadhwa’s (et al) research, a growing number of foreign born nationals that have attended US schools and are employed in the US are deciding to return to their native countries. One of the most highly cited reasons is a greater sense of opportunity in their country of origin. Moreover, of those returning, something like 52% plan to start a business within 5 years. \r\n\r\nThe most interesting question, it seems to me, is this perception of relative value arbitrage. I briefly explored this question with Vivek. Specifically, what is the distribution of returnees based on education, employment compensation? Is there a perception of a glass ceiling or some other dynamic at work?  As of yet, the data is inconclusive to this question. \r\n\r\nI suspect that, at least part of the answer can be found with something you hinted at; Silicon Valley now competes for talent across a much more challenging fitness landscape. If accurate, this view may suggest different (more difficult) policy implications than liberalizing immigration to attract and retain talent. \r\n\r\nKind regards, \r\n\r\nChris Jones'),
(1398, 'The most interesting question, it seems to me, is this perception of relative value arbitrage. I briefly explored this question with Vivek. Specifically, what is the distribution of returnees based on education, employment compensation? I'),
