(1421, 'Why Companies Posting Information to Accredited Investors on the AngelList Website are Not Engaged in a General Solicitation'),
(1422, 'August 30, 2012\r\nAngelList LLC\r\nSan Francisco, California 94107\r\nRe: K&amp;L Gates Opinion as to Why AngelList Does Not Need To Register as a Broker and\r\nWhy Companies Posting Information to Accredited Investors on the AngelList\r\nWebsite are Not Engaged in a General Solicitation\r\nLadies and Gentlemen:\r\nAngelList LLC (“AngelList”) operates a website (http://angel.co/), which permits\r\ncompanies seeking angel financing (the “Companies”) and accredited investors\r\n(“Investors”) to meet and communicate. You have requested that we provide this written\r\nopinion as to whether AngelList must register as a broker or dealer and whether a Company\r\nusing AngelList’s website will be engaged in a general solicitation of securities in violation\r\nof Rule 506 of Regulation D under the Securities Act of 1933, as amended (the “Securities\r\nAct”).\r\nI. OVERVIEW OF OPINION\r\nBased on the facts, analysis and reasoning discussed below, as well as AngelList’s\r\nrepresentations, and subject to the limitations and assumptions set forth herein, it is our\r\nopinion that: (1) AngelList is not required to register with the Securities and Exchange\r\nCommission (“SEC” or the “Commission”) as a “broker” or “dealer;”1 and (2) a Company\r\nthat posts information relating to a potential financial transaction on AngelList’s website for\r\nreview by accredited investors will not be engaged in a general solicitation of securities in\r\nviolation of Rule 506 of Regulation D under the Securities Act (“Regulation D”).\r\n1 Exchange'),
(1423, 'angellist'),
