(1430, 'In rendering this opinion, we have relied entirely upon the factual information\r\nprovided to us by you, as summarized or discussed herein. We have not attempted to\r\nindependently verify this information, and we assume no responsibility to do so. We also\r\nassume that this information does not contain any material misstatement of fact and does not\r\nomit any material factual matter.\r\nSection 201(c) of the Jumpstart Our Business Startups Act (the “JOBS Act”), as\r\ncodified in Section 4(b) of the Securities Act, expressly provides that entities engaged in\r\nactivities similar to those of AngelList, and operating pursuant to conditions that AngelList\r\nsatisfies, are not required to register as a “broker” or a “dealer.” In fact, AngelList is\r\nmentioned in the legislative history of Section 201(c) of the JOBS Act,2 and specifically for\r\nthe success that its high standards for investors and vetting efforts have brought to its model.3\r\nAside from Section 4(b) of the Securities Act, we are not aware of any statutes, judicial cases,\r\nCommission rulings, or other binding authority directly addressing the issues raised in this\r\nopinion.\r\nII. FACTUAL BACKGROUND\r\nYou have advised us of, and we have assumed for purposes of this opinion, the\r\nfollowing relevant facts, which we have not independently verified:\r\nAngelList was founded in 2010 to operate a website (http://angel.co/) that permits\r\nCompanies seeking angel financing and Investors, who are accredited investors,4 to meet and\r\ncommunicate with each other. AngelList is, in essence, a networking website for early stage\r\ncompanies and angel investors (as well as related professionals, such as lawyers and\r\nrecruiters), combined with other “social network” functionality.5\r\nAny private company can post on the website general information about itself, its\r\nproducts or services, and its management team, and that information is publicly available.\r\nCompanies also can post information, including information about potential fundraising\r\n2 See Testimony of Tim Rowe, Founder and CEO, Cambridge Innovation Center, March 6, 2012.\r\n3 See Written Testimony of Dana Mauriello, Co-Founder and President of ProFounder, to the Subcommittee\r\non Capital Markets and Government, September 21, 2011 (“AngelList . . . gained notoriety because of their\r\ncareful curation of deals and the social validation tools that they employ to keep the network of investors and\r\nentrepreneurs of a very high caliber.”).\r\n4 Rule 501 of Regulation D generally defines an “accredited investor” to include: (1) a bank, insurance\r\ncompany, registered investment company, business development company, or small business investment\r\ncompany; (2) an employee benefit plan, within the meaning of the Employee Retirement Income Security Act, if\r\na bank, insurance company, or registered investment adviser makes the investment decisions, or if the plan has\r\ntotal assets in excess of $5 million; (3) a charitable organization, corporation, or partnership with assets\r\nexceeding $5 million; (4) a director, executive officer, or general partner of the company selling the securities;\r\n(5) an entity in which all the equity owners are accredited investors; (6) a natural person who has individual net\r\nworth, or joint net worth with the person’s spouse, that exceeds $1 million at the time of the purchase, excluding\r\nthe value of the primary residence of such person; (7) a natural person with income exceeding $200,000 in each\r\nof the two most recent years or joint income with a spouse exceeding $300,000 for those years and a reasonable\r\nexpectation of the same income level in the current year; or (8) a trust with assets in excess of $5 million, not\r\nformed to acquire the securities offered, whose purchase is directed by a sophisticated person.\r\n5 Among the social networking functions permitted by the website are the ability of Companies to limit\r\nwhich Investors see their information, and the ability of users to communicate with and track the web site\r\nactivity of other users.\r\nAngelList\r\nAugust 30, 2012\r\nPage 3 of 14\r\nactivities, on a restricted portion of the website. In order to gain access to this portion of the\r\nwebsite, a potential Investor must be an accredited investor.6 AngelList requests information\r\nwith respect to a potential Investor’s accredited investor status. Upon review of this\r\ninformation, AngelList will either confirm that the Investor is an accredited investor, and\r\ngrant the Investor access to the restricted portion of the website, or it will request additional\r\ninformation in order to make this determination. Finally, the potential user must be granted\r\naccess to the restricted information of a specific Company by that Company. AngelList will\r\nremove an Investor from being able to view the restricted portion of the website if AngelList\r\nlearns that the Investor does not use the site in a professional manner, or if AngelList receives\r\nrepeated complaints about that Investor.\r\nThe above described access, eligibility and monitoring features are an integral part of\r\nthe success of the website. AngelList seeks to attract an experienced group of Investors and\r\nprofessionals. This group can and does efficiently share valuable observations, information\r\nabout prior investment experiences, and analyses with Companies, as well as with each other.\r\nInvestors can use the system to sort Companies by various criteria, such as location\r\nand industry focus. Investors can also follow what Companies other users of the site are\r\ninterested in, and can use the site to discuss particular Companies (and other matters) with\r\nother Investors. Companies have the ability to limit the types of Investors who can see their\r\ntransaction-related information, and can approve other Investors who request to see that\r\nCompany’s transaction-related information. Companies and Investors can use the site to\r\nreport their experience – good or bad – with other Investors or Companies.\r\nThe website automatically scans information posted by Companies in the public\r\nportion of the website and flags that posting for a manual review. On occasion, AngelList\r\nhas become aware of information that could be deemed a general solicitation or public\r\noffering, and has removed the offending information from the website. AngelList will also\r\nremove postings after determining that a company is a non-technology company, has posted\r\nincomplete information, has posted duplicate information, or is not a feasible enterprise (for\r\nexample, a company that proposes to develop a perpetual motion machine). AngelList does\r\nnot review or monitor proposed transactions or similar terms on the restricted portion of the\r\nwebsite.\r\nAngelList also provides a “curation” function. As AngelList reviews new transactionrelated\r\npostings, it may manually identify a Company that is not particularly well-connected\r\nor well-known in the angel investing community, but that provides an interesting opportunity\r\nbased, perhaps, on its founder or customer traction. AngelList will send information about\r\nthe Company to a group of approved Investors who have identified the Company’s business\r\nor geographic area to be of interest. AngelList does not perform due diligence and does not\r\n6 Currently, an Investor generally also must meet an additional sophistication requirement, by demonstrating\r\nthat he or she previously has made angel investments, that he or she is an investment professional, or that he or\r\nshe is recommended by at least one other investor on the site. Currently, AngelList may grant provisional\r\naccess to the website to potential Investors who are accredited investors, but who have not met this additional\r\nsophistication requirement. In the future, AngelList may allow all accredited investors full access to the\r\nrestricted portion of the website without the requirement of previous angel investing experience. Regardless of\r\nany internal sophistication requirements set by AngelList, all Investors must be accredited investors, and\r\ntherefore, the continued application of, or the failure to continue to apply, any such sophistication requirement\r\ndoes not impact this opinion.\r\nAngelList\r\nAugust 30, 2012\r\nPage 4 of 14\r\nfocus on proposed transaction terms. AngelList does not recommend or otherwise suggest\r\nthat any Investor make an investment in a particular Company, or that any Company offer\r\nsecurities to a particular Investor. AngelList believes that this curation function is valuable to\r\nthe Companies, which may not have the experience or the expertise to know that particular\r\nInvestors may be able to help them, and further believes it is valuable to the Investors, who\r\nmay not have the time to sift through all of the different transaction-related postings that\r\ncome onto the site.\r\nAngelList makes available on its website standardized transaction documents, which\r\nmay be accessed and downloaded by Investors or Companies who wish to engage in a\r\ntransaction. The Investors and Companies may then complete the transaction documents\r\nwith separately negotiated terms and effect the transaction through a registered broker-dealer.\r\nUse of the form documents is entirely optional and the transactions for the purchase or sale of\r\nCompany securities are not effected on or through the AngelList website.\r\nNotably, in addition to the fact that no transactions are executed on or through the\r\nwebsite, AngelList receives no direct or indirect compensation from users of the website,\r\nfrom the Companies seeking financing, or from the Investors on the website. There also is no\r\nadvertising on the website. If one or more of the Investors decides to provide angel funding\r\nto a Company, the Investors and the Company will enter into direct negotiations, which will\r\nnot involve AngelList or the website. Indeed, AngelList may and often will be entirely\r\nunaware of these negotiations, although AngelList may try to obtain information about\r\nsuccessful investments after they have occurred on a voluntary basis.\r\nThe founders of AngelList have participated in certain co-investment activities\r\ninvolving the Companies. For example, the founders of AngelList were asked to and did\r\nestablish a private fund on behalf of an investor in AngelList with the purpose of co-investing\r\nin promising startup companies.7 Additionally, one of the AngelList’s founders also manages\r\na private fund that began, and made a majority of its investments, prior to the existence of\r\nAngelList and its website.8 Finally, each of AngelList’s two founders, from time-to-time,\r\nmakes angel investments in Companies on the site. When they do so, they are acting in their\r\npersonal capacities, and not on behalf of AngelList or the website.9\r\nIII. ANGELLIST IS NOT REQUIRED TO REGISTER AS A BROKER OR\r\nDEALER.\r\nA. AngelList is Not Required to Register as a Broker or Dealer Pursuant to\r\nSection 4(b) of the Securities Act.\r\nIn April 2012, President Obama signed into law the JOBS Act, which is aimed at\r\neasing the regulatory burdens of initial public offerings and private placements in an effort to\r\nfacilitate access to capital markets. In relevant part, Section 201(c) of the JOBS Act provides\r\na specific exemption from registration as a broker or dealer for entities providing certain\r\n7 Neither AngelList, nor its founders, collected any fees in connection with this fund.\r\n8 The terms of the investments were negotiated directly by the founder in his capacity as manager to the fund\r\nand did not involve AngelList in any way.\r\n9 The founders, and the companies in which they invest, receive no special treatment or recognition on the\r\nwebsite.\r\nAngelList\r\nAugust 30, 2012\r\nPage 5 of 14\r\nservices and meeting certain conditions. This exemption was codified as Section 4(b) of the\r\nSecurities Act. Section 4(b) of the Securities Act provides an exemption for registration as a\r\nbroker if a person, with respect to securities offered and sold in compliance with Rule 506 of\r\nRegulation D10: (i) “maintains a platform or mechanism that permits the offer, sale, purchase,\r\nor negotiation of or with respect to securities or permits general solicitations, general\r\nadvertisements, or similar or related activities by issuers of such securities, whether online, in\r\nperson or through any other means;” (ii) co-invests in such securities; or (iii) provides\r\n“ancillary services” with respect to such securities.11 In order to qualify for this exemption,\r\nthe person, and all of its associates, must (1) receive no compensation in connection with the\r\npurchase or sale of such securities; (2) not have possession of customer funds or securities in\r\nconnection with the purchase or sale of such securities; and (3) not be disqualified from\r\nmembership in a self-regulatory organization under Section 3(a)(39) of the Securities\r\nExchange Act of 1934, as amended (the “Exchange Act”).12\r\nAngelList is in full compliance with the conditions of Section 4(b) of the Securities\r\nAct and, therefore, is exempt from the requirement to register as a broker. AngelList\r\nmaintains a website that permits Companies to offer securities in compliance with Rule 506\r\nof Regulation D (although no sales can be executed through the AngelList website).13 In\r\nconnection with its website, neither AngelList nor any person associated with AngelList:\r\nreceives any compensation in connection with the purchase or sale of securities through its\r\nwebsite; has possession of customer funds or securities in connection with the purchase or\r\nsale of securities through its website; or is disqualified from participation in a self-regulatory\r\norganization.14\r\n1. AngelList Receives No Compensation in Connection with the Purchase\r\nor Sale of Securities through Its Website.\r\nAngelList and individuals associated with AngelList receive no compensation in\r\nconnection with the purchase or sale of securities through its website. There are no fees\r\nassociated with accessing the general information on the AngelList website, or for gaining\r\naccess to the restricted portion of the website. Neither the Investors nor the Companies pay\r\nAngelList for the use of its website. Furthermore, there are no advertisements on the\r\n10 We note that because AngelList does not effect any transactions for the purchase or sale of securities, it is\r\nnot clear that the provision in Section 4(b) requiring that the transaction be in compliance with Rule 506 of\r\nRegulation D is even applicable to AngelList. However, because AngelList is available only to accredited\r\ninvestors, AngelList has, to the best of its ability, ensured that all transactions made as a result of a connection\r\nthrough AngelList are eligible to comply with Rule 506 of Regulation D.\r\n11 “Ancillary services” are defined in Section 4(b) of the Securities Act to include: (1) the provision of due\r\ndiligence services, in connection with the offer, sale, purchase or negotiation of such security, so long as such\r\nservices do not include for separate compensation, investment advice or recommendations to issuers or\r\ninvestors; and (2) the provision of standardized documents to the issuers and investors, so long as such person or\r\nentity does not negotiate the terms of the issuance for and on behalf of third parties and issuers area not required\r\nto use the standardized documents as a condition of using the service.”\r\n12 Section 3(a)(39) of the Exchange Act provides certain activities that would subject a person to a “statutory\r\ndisqualification” with respect to membership or participating in a self-regulatory organization. Such activities\r\ngenerally include a previous expulsion from a self-regulatory organiz'),
(1431, 'Previously, the founders of AngelList created a private fund on behalf of an Investor\r\nin AngelList with the purpose of investing in Companies listed on the AngelList website.\r\nThe fund made several investments, but neither AngelList nor any of its employees or\r\nassociates collected any fees in connection with this fund. Similarly, a founder of AngelList\r\nmanages a private fund unrelated to AngelList that makes various investments, a majority of\r\nwhich include opportunities not discovered through the AngelList website. Again, neither\r\nAngelList nor any of its employees or associates collected any fees in connection with this\r\nfund. Co-investment is specifically permitted by Section 201(c) of the JOBS Act15, and as\r\nthere was no compensation received by AngelList in connection with the formation or\r\noperation such funds, such funds do not impact the analysis of whether AngelList has\r\nreceived compensation in connection with the purchase or sale of securities through its\r\nwebsite.\r\n2. AngelList Does Not Have Possession of Customer Funds or Securities\r\nin Connection with the Purchase or Sale of Securities through Its\r\nWebsite.\r\nAngelList takes no part in the negotiation or execution of transactions for the\r\npurchase or sale of securities, and at no time has possession of Investor or Company funds or\r\nsecurities. No transactions are executed or negotiated on or through the AngelList website.\r\nIf one or more of the Investors wishes to invest in a Company, the Investors and the\r\nCompany will enter into direct negotiations entirely separate from AngelList and the\r\nAngelList website. In fact, AngelList in many cases does not know that a transaction for the\r\npurchase or sale of a Company’s securities occurred.\r\n3. AngelList is Not Subject to a Statutory Disqualification With Respect to\r\nMembership in a Self-Regulatory Organization.\r\nEntities are subject to a statutory disqualification with respect to membership in a\r\nself-regulatory organization if, among other things: (1) the entity was previously expelled\r\nfrom a self-regulatory organization; (2) the entity was subject to a suspension or revocation of\r\nregistration with the Commission or a foreign regulatory authority; or (3) a person associated\r\nwith the entity has been subject to any action described in items (1) or (2) or has been\r\nconvicted of any other felony within ten years of the date of the application for membership\r\nin the self-regulatory organization.16 Neither AngelList nor any associated person has been\r\nsubject to criminal or regulatory sanctions that would cause a statutory disqualification with\r\nrespect to membership in a self regulatory organization. As a result, AngelList satisfies the\r\nthird condition of Section 4(b) of the Securities Act.\r\n15 Section 4(b)(1)(B) of the Securities Act.\r\n16 Section 3(a)(39) of the Exchange Act.\r\nAngelList\r\nAugust 30, 2012\r\nPage 7 of 14\r\n4. AngelList is in Compliance with Section 4(b) of the Securities Act and\r\nMay, Therefore, For No Additional Compensation, Provide Ancillary\r\nServices with Respect to the Purchase and Sale of Company Securities.\r\nSection 4(b)(1)(C) of the Securities Act provides that entities meeting the conditions\r\nof the section are permitted to provide ancillary services with respect to the securities being\r\nsold in compliance with Rule 506 of Regulation D. Ancillary services include, in relevant\r\npart: (1) the provision of due diligence services in connection with the sale of such securities,\r\nprovided that the services do not include, for separate compensation, investment advice or\r\nrecommendations;17 and (2) the provision of standardized documents to the issuers and\r\ninvestors, so long as such person or entity does not negotiate the terms of the transaction for\r\nand on behalf of third parties and issuers are not required to use the standardized documents\r\nas a condition of using the service.18\r\nThe “curation” services that AngelList'),
