(1433, 'A Summary What Helps Shape Our Vision\r\n\r\nSparkFire Labs has identified ten converging trends that will drive the emergence and growth of the innovation and entrepreneur market we seek to serve. \r\n\r\nThe Edges of the Internet Are Expanding\r\n \r\n“The...'),
(1434, 'A Summary What Helps Shape Our Vision\r\n\r\nSparkFire Labs has identified ten converging trends that will drive the emergence and growth of the innovation and entrepreneur market we seek to serve. \r\n\r\nThe Edges of the Internet Are Expanding\r\n \r\n“The Internet is based on a layered, end-to-end model that allows people at each level of the network to innovate free of any central control. By placing intelligence at the edges rather than control in the middle of the network, the Internet has created a platform for innovation.”\r\n\r\n-Vinton Cerf, co-founder of the Internet\r\n \r\nOnly about a third of the world is connected to the Internet. However, the edges of the network or the “connected world” will increase by roughly 1 billion people, or 50% between 2011 and 2015. Many of the new comers are connecting from the 80% of the global population that exist on less than $10 a day and an astonishing 2.56 billion who subside on less than $2 a day. \r\n \r\nBecoming connected in the developing world is a significant cost for many on the economic fringe but it represents a compelling financial investment. The Internet represents an opportunity platform from which one can leapfrog locally inadequate social and economic infrastructures and connect with the global community. Mobile devices are increasingly affordable and benefit from cloud-based and downloadable applications which reduce device requirements,  enabling low-cost devices to access remotely hosted and tailored resources. \r\n\r\nToday’s Internet is a wealth of opportunity, from accessing free education and skill development resources to seeking employment opportunities. In short, joining the global Internet community provides multiple rungs on the ladder of upward mobility.   \r\n \r\nAs a result, Internet-based labor pools are swelling at high double digit rates and reflect the increasingly fungible nature of labor. In 2012 freelance employment transactions will surpass $1 billion dollars and likely to approach $1.5 billion in 2013. As the labor market expands, more industries and niche specializations are being represented in the freelance market. In addition, online labor is capturing nontraditional freelancers from developed countries who use online labor markets as a means to gain side employment. Likewise, employers are increasing their reliance on outsourced and contingent labor.\r\n\r\nThe emergence of global talent pools is to codify employment norms as well as spreading a global culture that embodies an entrepreneurial ethos and a culture that is acclimated to opportunity discovery, cross cultural collaboration, remote work and an awareness of free or inexpensive online tools and resources.'),
(1435, 'SparkFire Labs has identified ten converging trends that will drive the emergence and growth of the innovation and entrepreneur market we seek to serve.'),
