(1490, 'The Role of Dynamic Networks in Social Capital:\r\nA Simulation Experiment\r\n\r\nSandra González Bailón\r\nUniversity of Oxford. Nuffield College\r\nsandra.gonzalezbailon@nuffield.ox.ac.uk\r\n\r\ntest, test test Abstract\r\nThis paper has two basic aims: the first is to understand why networks matter in the creation\r\nand maintenance of social capital; the second is to explore many of the (unproved) assumptions\r\nthat arise when social capital is applied to the field of political participation. A simulation-\r\nbased experiment is used to achieve both aims. The paper starts by delimiting the scope\r\nof the theoretical problem. It then reviews the assumptions made in the literature about the\r\nrole networks play for social capital, and integrates them with what is known about dynamic\r\nnetworks. The third section provides a brief introduction to the methodological nature of\r\nsimulation. It justifies the appropriateness of this technique to tackle the questions posed by\r\nthe existing theory. A description of the simulation model and its results follows. The first\r\nset of experiments explores the structural properties of different networks in respect of information\r\ndiffusion. The second set analyses a principle of action that might be responsible for\r\nthe formation of social capital networks. The implications that these results have for the theory\r\nare assessed in the conclusion. Their links to future research are also discussed.\r\nKey words: social capital, networks, political participation, multi-agent simulation.\r\nResumen. El papel de la redes dinámicas en el capital social: un experimento de simulación\r\nEl objetivo de este artículo es doble: por un lado, entender por qué importan las redes en\r\nla creación y mantenimiento de capital social y, por otro, explorar muchas de las asunciones\r\n(no probadas) que surgen cuando el concepto de capital social se aplica al campo de\r\nla participación política. Ambos objetivos se llevan a cabo con la ayuda de un experimento\r\nde simulación. El artículo empieza exponiendo los términos del problema teórico.\r\nProsigue con un resumen de las asunciones que aparecen en la literatura sobre el rol que\r\nlas redes juegan en el funcionamiento del capital social y las contrasta con lo que se sabe acerca\r\ndel funcionamiento de redes dinámicas. La tercera sección proporciona una breve introducción\r\na la naturaleza metodológica de la simulación multi-agente. Le sigue una descripción\r\ndel modelo de simulación y de sus resultados. El primer conjunto de experimentos\r\nexplora las propiedades estructurales de distintas redes respecto a la difusión de información.\r\nEl segundo conjunto analiza un principio de acción responsable de la formación de redes\r\nde capital social. Las implicaciones teóricas de estos resultados son valoradas en la conclusión.\r\nTambién se discuten futuras líneas de investigación.\r\nPalabras clave: capital social, redes, participación política, simulación multi-agente.\r\nPapers 80, 2006 171-194'),
