(2258, '<p>i''m looking at the start times and it looks like there is a 4 hour difference between our time 10AM and your time 2pm.&nbsp;</p>\r\n<p>But I''m confused when I look at whose time is who''s. I scheduled the conference call, but it says my time 2pm. Am I reading this right?&nbsp;</p>\r\n<p>A little confusing.</p>\r\n<ul>\r\n<li><strong>Start date:</strong>&nbsp;\r\n<div>February 19, 2013</div>\r\n</li>\r\n<li><strong>Start time:</strong>&nbsp;\r\n<div>10:00&nbsp; Hs</div>\r\n</li>\r\n<li><strong>Timezone:</strong>&nbsp;\r\n<div>America/North_Dakota/Center</div>\r\n</li>\r\n<li><strong>Start date on your city:</strong>&nbsp;\r\n<div>February 19, 2013</div>\r\n</li>\r\n<li><strong>Start time on your city:</strong>&nbsp;\r\n<div>16:00 Hs</div>\r\n</li>\r\n<li><strong>Duration:</strong>&nbsp;\r\n<div>5&nbsp; Hs</div>\r\n</li>\r\n<li><strong>Maximum number of participants:</strong>&nbsp;\r\n<div>5</div>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
