(508, 'Golden Spike to Crowdsource $240,000 for Lunar Marketing Campaign', 'According to Parbolic Arc, the Golden Spike Company, a private group that proposes to launch commercial flights to the moon, is launching a crowdsourcing campaign that is part fund raiser and part public relations stunt.\r\n\r\nGolden Spike wants to raise $240,000\r\n\r\nGolden Spike, through the crowdsourcing site Indiegogo, is launching a campaign to raise $240,000, one dollar for every mile between the Earth and moon. The purpose of the fund-raiser is to involve the public in a marketing campaign that will raise awareness of the company''s intent to send people to the lunar surface for the first time in decades, only this time commercially. "Most directly, the campaign will enable us to start to create interactive media products, apps, and an Olympics-movement style membership program to engage kids and adults in exciting, modern ways, to be insiders in the future exploration of the moon by people." \r\n\r\nContinue Reading:\r\nhttp://news.yahoo.com/golden-spike-crowdsource-240-000-lunar-marketing-campaign-195100355.html'),
(510, 'Proof: crowdsourcing solves problems faster and more accurately! February 12, 2013', 'Researchers from Harvard Medical School, Harvard Business School and London Business School recently collaborated on a study using crowdsourcing as a problem-solving tool for complex biological issues. Study partner TopCoder, a crowdsourcing platform with a large global community, joined the research team in an effort to capture the potential value of open innovation for conducting basic scientific research. \r\n\r\nOpening the challenge of creating a system (that can analyze a wealth of data to predict genetic configurations in the immune system) to the community yielded a program with unprecedented accuracy and results. Two weeks after the contest was opened, 122 different individuals posited solutions. From there the viable options were narrowed to 16, which were more accurate and up to 1,000 times faster than either Arnaout’s or the NIH’s BLAST algorithm. The top five were released under an open source license.\r\n\r\nContinue Reading:\r\nhttp://www.openinggovernment.org/proof-crowdsourcing-solves-problems-faster-and-more-accurate/'),
