(512, 'First We Kill The Clueless Investors: Nab Angels That Deliver More Than Cash', 'In order to identify an Angel investor that will deliver more than cash to your venture, you must assess three important parameters: (i) the relative strength of their personal brand, (ii) their ability to add operational value, and (iii) the amount of care and feeding they will demand from you.\r\n\r\nAngel investors are often the sole source of funding for startups at the critical pre-launch stage. Ideally, such early-stage investors should have the experiences and motivation to help their ventures establish a sustainable business model, rather than simply writing a check before moving on to their next investment.\r\n\r\nFour Common Angel Archetypes\r\n\r\nThere are a variety of factors entrepreneurs should consider when evaluating a potential early-stage investor. Three criteria that impact an investor’s ability to add non-monetary value to your venture are: Brand, Tactical Impact and Overhead. Four distinct types of Angels emerge when they are evaluated per these parameters, as shown below.\r\n\r\nContinue Reading:\r\nhttp://www.forbes.com/sites/johngreathouse/2013/02/13/first-we-kill-the-clueless-investors-nab-angels-that-deliver-more-than-cash/'),
(513, 'Competition to Live in Kansas City Startup Village House', 'Kansas City, MO - infoZine - Brad Feld link, a venture capitalist at Foundry Group, noted advocate for entrepreneurs and author of the book Startup Communities link, has been lauded for his hands-on role in helping to make Boulder, CO a thriving hub for high-tech startups. Now he announces a venture that will extend his support for entrepreneurs about 600 miles to the east — to metropolitan Kansas City.\r\n\r\nContinue Reading:\r\nhttp://www.infozine.com/news/stories/op/storiesView/sid/54892/'),
