(404, 'Open or Closed Project', 'I''ve debated whether to make this an open project or a closed project. At this point, I think I want to keep it closed and just available to those we have invited. In the future, if we want to open it up and let others request to join the project, that will be fine. \r\n\r\nI''ve also considered the visibility of the project. For now I''ve decided it will be invisible so it is not going to show up on any searches, anyone''s projects etc....\r\n\r\nOnce we get further along, then I think it would be a good idea to let people know what we''re developing.  Comments?'),
