(506, 'The Role of Social Capital In Social Networks &amp; Viral Capacity', 'Goal: SparkFire Labs will dominate the innovation and entrepreneurial collaboration space and will do so via a detailed campaign and enabling technology design within SparkFire Labs.\r\n \r\nSummary\r\n\r\n“Viral growth” is a term borrowed from epidemiology and is used to describe the rapid diffusion of information and technology through self-replicating “infectious” contact between infected and non-infected individuals. \r\n\r\nEmbed high viral capacity into technology design and function\r\nUser Motivations: \r\n\r\n1.	Acquire and Leverage Social Capital:\r\nSocial capital refers to the individual’s collection of social ties that provides access to resources, information or assistance and from which one can derive market and non-market benefits (better social status, better educational and professional achievement\r\n\r\nAcquire Social Capital: Form of market signaling\r\n		Enhance Reputation / Social Status: Peacock and Megaphone\r\n\r\n	Increase recognition\r\n	Expand social network\r\n	Increase number of followers\r\n	Increase and expand influence \r\n	Associate with influential nodes and clusters (“friending”)\r\n	Collect Likes\r\n	Increased social interaction\r\n	Increase number of views\r\n	Sharing\r\n	Re-contextualizing existing relationships around entrepreneurship / innovation identity\r\n	Tribal identity / Sense of belonging\r\n	Escapism\r\n	Expression / creativity\r\n	Altruism\r\n\r\nEmbeddednes\r\n\r\nNetwork Embeddedness: phenomena that are embedded in the underlying social structure (integrated in the network of connections that define how agents interact and communicate. Technology design and embedded viral capacity SparkFire is hard wired with Viral DNA Viral Capacity has to do with a subscriber finding enough value in what you offer to pass your material on to someone else and demonstrating their own value level to you simultaneously.\r\n\r\nHow to harness user social capital motivations to reduce viral cycle time, increase number of invites and positively impact conversion rates. Means by which SparkFire Labs enables users to enhance their social capital: \r\n\r\n1.	Infected hosts can increase their perceived social status by inflating the number of followers by automatically capturing more followers through an automated follow design feature that is activated when an invitee converts to a SparkFire Labs subscriber. Followers automatically receive activity feeds from the invertor, creating social capital. \r\n\r\n2.	Liberal opportunities for users to messages outside the network to members of other networks (Twitter, FB, Linkedin), \r\n\r\n3.	UGC (User-Generated Content) \r\n\r\n4.	Blogs provide a contextualized way for individuals to self promote, promote ideas, projects etc and alert non network users. Blogs may be submitted for site-wide publication which elevates a user’s profile / status, encourages interaction, and increases time on site and increases frequency of returns. Blogs / users can receive recognition / reputation enhancement based on number of follows, fast rising, most commented and other game mechanics. \r\n\r\n5.	User’s may post a blog and alert others outside of network. \r\n\r\n6.	Comments enable interaction among users\r\n\r\n7.	Viral campaigns among geographically define homophilous  networks exhibiting small world properties  with high clustering means that many of the recently infected are likely to know or know of many of the others who are joining within the same temporal dimension of a campaign. This bridges the physical and virtual worlds and should positively impact viral coefficient through higher conversion rates and interactivity among new users. \r\n\r\n8.	Analytics / feedback: People are ultimately fascinated by themselves, their identity and place in the world. While likely to be statistically insignificant at best, users are likely want to have a sense of their “performance” on a site, track their “progress” and view graph data. While likely to be statistically insignificant at best, \r\n\r\nAcquire Access to Resources:\r\n		Novel Information Discovery\r\n•	Learning About\r\n•	Learning How\r\n•	Experimentation\r\n	Opportunity Discovery\r\n	Access human capital\r\n•	Employment\r\n•	Participation\r\n	Access to influential nodes and clusters\r\n	Increase access or potential sources of capital\r\n	Socialization\r\n	Recommendation\r\n	Search\r\n\r\nResource Management / Coordination\r\n	Increase Efficiency / Productivity\r\n		Synchronize / Coordinate effort\r\n1.	Task Management\r\n2.	Planning\r\n3.	Testing\r\n4.	Tracking\r\n5.	Reporting\r\n6.	Meetings\r\n7.	Deadlines \r\n8.	Prioritization\r\n9.	Project management\r\n10.	Scheduling \r\n11.	Milestones\r\n12.	Estimating\r\n13.	Reminders\r\n14.	Information Sharing\r\n\r\nFeedback\r\n\r\nMeasure and Monitor: Statistical analytics: Users and community require metrics and tools to establish leaders, most followed, most read, most shared etc….that allow them to see who looked at their profile, \r\n\r\nContent Strategy:\r\n\r\nContent is important to help foster a lifestyle or culture: \r\nContent aggregation from many sources:  \r\n•	Aggregated from news providers and blogs\r\n•	UGC\r\nSimilar to Linkedin: Content appears with a link, number of likes, comments, also “SparkFire Labs” share button” based on feedback the story may be listed in most popular category, most commented. When link clicked, open new browser, \r\nCan ask blogs we feature to include SparFire Labs share button\r\n\r\nRobustness: The resilience of certain network features( overall connectivity)which may be crucially affect performance/ \r\nSearch: procedure by which individual nodes may look for, and then access, disperse information\r\nDiffusion: phenomenon that governs the gradual spread over time of any kind of signals, knowledge, opinions, and fads or behavior\r\nDecrease information costs\r\nDecrease diffusion costs\r\nIncrease reach, diffusion\r\nIndividual nodes have their behavior shaped by their prevailing objectives and expectations which will affect the network. Agent behavior must be conceived and modeled as embedded in the social network.'),
