(498, 'Citizen Science &amp; The Coming Manufacturing Revolution', 'Individuals are motivated by a multitude of desires including self-expression and financial opportunity. As the financial cost and risk associated with acting on those desires approaches zero, all things being equal, we would expect to see more opportunity seeking behavior. \r\n\r\nInnovation and entrepreneurial behavior is, at its heart, an act of collaboration, resource acquisition and reconfiguration toward some desired end. Technology and cultural changes are lowering seeking and collaboration costs while pushing tools and resources from the center to the edges of the global network.'),
