(515, 'MIT''s $1 Million Test to See if Social Media Can Make Investors Money', 'MIT researchers are giving 10,000 Asian students $100 each to invest in the stock market, hoping to prove a theory that, under the right circumstances, social networks can improve financial decisions.\r\n\r\nThe concept, which has support in a previous test, is counterintuitive: Most principles of investing argue that you can only profit from information that’s not known to others. But the researchers, Yaniv Altshuler and Alex Pentland, think that traders can benefit from making investment decisions as a group, if they know whose advice to follow.\r\n\r\nThe test this March will use eToro, a social network for investors, with the money traded on stock markets in Hong Kong and Singapore. ”This study will show that by wisely using a network as a medium for exchanging information, you can generate a non-zero sum game,” Altshuler said in an interview. “This creates a synergy where all of the participants are winning together. That’s the goal.”\r\n\r\nContinue Reading: \r\nhttp://www.minyanville.com/sectors/technology/articles/Altshuler-headline-tk-users-eToro-social/2/14/2013/id/48127'),
