(411, 'Demo Day Indiana University', 'Demo Day is an evening long event (April 5th from 5-9 pm) in which 23 student projects from across campus will compete for cash and prizes, including meetings with local and regional angel investors and venture capitalists. Teams are drawn from diverse schools, including computer science, informatics, the MIME program, business and chemistry. This year also includes the first time a project has been submitted from the school of music. \r\n\r\nWinners will receive cash, prizes and bragging rights as well as meetings with area and regional angel investors and venture capitalists. The top three projects will also be invited to compete in the Big Ten Innovate-off, which will pit top teams from Big Ten universities against one another. \r\n\r\nCome root for us!'),
