(549, 'What github links are available?', '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>'),
(550, 'Hotlanta''s startup scene is So So Def', '<p><span class="dropCap">W</span>hen <strong>Scott Henderson</strong> toured Tech Square at the <strong>Georgia Institute of Technology</strong>, and then learned that a few Atlanta startups had the same hometown giants Delta Air Lines and Home Depot, he saw the makings of a Boston Innovation District&mdash;in the middle South''s biggest metropolis.</p>\r\n<p>Henderson had advised Boston''s <a href="http://masschallenge.org" target="_blank"><strong>MassChallenge</strong></a>, the world''s largest accelerator and startup competition, and helped to launch chapters of the <a href="http://s.co" target="_blank">Startup America Partnership</a> in cities across the nation. He''d heard of many towns trying to be startup hubs as an advisory board member of the South by Southwest Festival.</p>\r\n<p>But Atlanta seemed to have a lot together. Not only had it watched startups like <a href="http://www.bizjournals.com/atlanta/blog/atlantech/2012/10/atlantas-pardot-acquired-by.html?page=all">Pardot</a>, <a href="http://www.bizjournals.com/atlanta/blog/atlantech/2012/05/oracle-acquires-vitrue.html" target="_blank">Vitrue</a> and <a href="http://news.cnet.com/2100-1040-252668.html" target="_blank">MindSpring</a> exit and return millions to shareholders, but it already had organizations congregated around Tech Square involved in helping startups be successful and colleges promoting entrepreneurship as a viable career option.</p>\r\n<p>"There is the serendipity I saw from the community we had in Boston and Cambridge," he said.</p>\r\n<p>What was missing was a hub of activity, where founders and students and investors and innovative large corporations could come together for meetups and chance encounters. There was still a shortage of investors and talent, and too few <strong>Fortune 500</strong> companies paying attention to the entrepreneurs building businesses in Atlanta. Henderson thought those challenges could be overcome with a central hub hosting prominent events, promoting the region and making the important connections between the city''s business leaders and startups.</p>\r\n<p>Continue reading:</p>\r\n<p>http://upstart.bizjournals.com/companies/startups/2013/02/14/atlanta-hot-on-startups.html</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
(551, 'SparkFire Labs Social Network Terms', '<p><strong>Definitions</strong></p>\r\n<p><strong>Social Network</strong></p>\r\n<p>&nbsp;A social network is a virtual community of people who interact around common interests via information sharing. Common examples of social networks include; Facebook, Twitter and Linkedin.</p>\r\n<p><strong>Profiles</strong></p>\r\n<p>Members create their own online "profile" with biographical data, photos and any other information they choose to post.</p>\r\n<p><strong>Relationships</strong></p>\r\n<p>Relationships define one&rsquo;s social network. Users are able to add to their network by finding and inviting others, such as friends, colleagues or friends of friends to join their personal.</p>\r\n<p>Within a social network, relationships are also used as a filtering mechanism to&nbsp; regulate communication and access content.</p>\r\n<p><strong>Communication</strong></p>\r\n<p>Users can often communicate through content sharing. A central component is often a blog-like format that permits posting of ideas, photos, posting links to other content or embedding content so other may read and respond. Email, instant messaging, voice and video conferencing are typically the ways in which members interact within a social network.</p>\r\n<p><strong>Activity and Notifications</strong></p>\r\n<p>Activity streams and notifications enable users to keep up to date of the activities of others within your social network. Examples include Linkedin&rsquo;s activity feed in which new connections, comments or postings of people within your network are posted or Facebook&rsquo;s news feed.</p>\r\n<p><strong>Groups</strong></p>\r\n<p>Groups provide a way for individuals to join together around a shared interest or purpose, regardless of geographical location. Groups may be focused around professional interests, hobbies or social causes. Examples would include computer programmers, entrepreneurs or college alumni groups.</p>'),
(552, 'SparkFire Video Conferencing & Collaboration Terms', '<p><strong>Video Conferencing</strong></p>\r\n<p>Using telecommunication technologies to connect two or more remotely located individuals so as to communicate simultaneously via video and audio transmission. Video conferencing adds a an important human element to any discussion. Non verbal communication is an important component&nbsp; of effective communication but&nbsp; is particularly relevant&nbsp; when collaborating, building trust or presenting complex ideas or concepts.&nbsp; Video conferencing is an effective, efficient and cost saving way to bridge geographical barriers.&nbsp; Common uses include:</p>\r\n<div>&bull;Collaboration</div>\r\n<div>&bull;Presentations</div>\r\n<div>&bull;Meeting</div>\r\n<div>&bull;Sales</div>\r\n<div>&bull;Training</div>\r\n<div>&bull;Webinars</div>\r\n<div>&bull;Remote Support</div>\r\n<div>&bull;Distance Learning</div>\r\n<p><strong>Document / Slide Sharing</strong></p>\r\n<p>Communication can be enhanced with the use of supplemental diagrams, spreadsheets, power point&nbsp; slides, images and other types of artifacts remotely.</p>\r\n<p><strong>White Board</strong></p>\r\n<p>A sharable white drawing surface used for teaching or presentations. White boards are particularly useful for demonstrating ideas or concepts on the fly.</p>\r\n<p><strong>Chat</strong></p>\r\n<p>A familiar form of communication including one to one private text messaging or a visible chat stream among many.</p>\r\n<p><strong>Presentation Record, Edit, Playback</strong></p>\r\n<p>Recording the visual, audio elements of a presentation in a digital file format that may be edited, combined with other media and played back at a later date. This is a power tool for creating a product commercial or refining a pitch.</p>'),
(553, 'What Is SparkFire Labs', '<p><strong>Overview</strong> </p>\r\n<p>SparkFire Labs was designed with the idea that novelty and innovation occur best and most frequently when individuals are exposed to and interact among an immersive milieu of people, interests and ideas.&nbsp;</p>\r\n<p>&nbsp;Powerful global forces are converging in a way that is driving down experimentation costs and individual risk while dramatically increasing the ability of individuals to self-organize around shared interests and pursue novel ideas individually or with others. We are at a global innovation inflection point that will redefine the process of innovation and start up culture in a way that will be more accessible, inclusive and democratic.</p>\r\n<p>SparkFire Labs is a next generation social network that&nbsp; combines a powerful social networking engine and collaboration and productivity tools within individual lab spaces. Each lab functions as a virtual workshop, supporting the individual tinkerer, university project teams or teams coming together to build the next big idea. Think of a global innovation co-working space in which your neighbour may be your next co-founder or investor is from across town or from another part of the world.</p>\r\n<p>SparkFire Labs is comprised of three primary components, social network, video conferencing suite and private work spaces we call labs.</p>'),
(554, 'SparkFire Labs Feature Set', '<p><strong>SparkFire Labs</strong> is comprised of three primary components, social network, video conferencing suite and private work spaces we call labs.</p>\r\n<p><strong>I.&nbsp; Social Network</strong></p>\r\n<div class="O1">&bull;&nbsp;Profile</div>\r\n<div class="O1">&bull;Networking</div>\r\n<div class="O1">&bull;Groups</div>\r\n<div class="O1">&bull;Blog</div>\r\n<div class="O1">&bull;micro-blogging</div>\r\n<div class="O1">&bull;Activity Stream</div>\r\n<div class="O1">&bull;File Sharing</div>\r\n<div class="O1">&bull;Google-like Circles</div>\r\n<div class="O1">&bull;News</div>\r\n<div class="O1">&bull;Events</div>\r\n<div class="O1">&bull;Blog-to news</div>\r\n<div class="O1">&bull;Search</div>\r\n<div class="O1">&nbsp;</div>\r\n<p><strong>&nbsp;II. Video Conferencing &amp; Collaboration</strong></p>\r\n<div class="O1">&bull;Multi-user interaction&nbsp;</div>\r\n<div class="O1">&bull;Audio / Video</div>\r\n<div class="O1">&bull;Presentation Mode with Slide &amp; Document Share</div>\r\n<div class="O1">&bull;Desktop Sharing</div>\r\n<div class="O1">&bull;White board</div>\r\n<div class="O1">&bull;Chat</div>\r\n<div class="O1">Record , Edit , Playback Presentations</div>\r\n<div class="O1">&nbsp;</div>\r\n<p><strong>III. Labs</strong></p>\r\n<div class="O1">&bull;Project Creation</div>\r\n<div class="O1">&bull;Google Drive / Calendar Integration</div>\r\n<div class="O1">&bull;Lean Kanban-Style Project Board</div>\r\n<div class="O1">&bull;Tasks</div>\r\n<div class="O1">&bull;Project Home Page</div>\r\n<div class="O1">&bull;Privacy Controls</div>\r\n<div class="O1">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Open, Closed, Invisible</div>\r\n<div class="O1">&bull;Project Type</div>\r\n<div class="O1">&nbsp; &nbsp; &nbsp; Commercial, Non-profit, Hybrid, Undecided&nbsp;</div>\r\n<div class="O1">&bull;Post Needs / Requests</div>\r\n<div class="O1">&bull;Team Building / Recruiting</div>\r\n<div class="O1">&nbsp; Job Posting, Direct-Invite To Other Social Networks</div>\r\n<div class="O1">&bull;Blog</div>\r\n<div class="O1">&bull;Activity Updates&nbsp;</div>\r\n<div class="O1">&bull;Internal File Transfer</div>\r\n<div class="O1">&bull;Internal Micro-Blogging</div>\r\n<div class="O1">&bull;Project Promotion</div>\r\n<div class="O1">&nbsp; Write-Once Project Status Updates / Promotions to Other Social &nbsp; Media Connection</div>'),
(555, 'NEED TO COMPLETE Lab Terms', '<p>Labs</p>\r\n<p>Cloud-based ideation and project work spaces offer the benefit of ubiquitous access to projects, files and resources. Each lab comes fully equipped and offers the flexibility to support&nbsp; multiple project&nbsp; and teams with role based controls.&nbsp;&nbsp;</p>\r\n<p>Project&nbsp; Creation:</p>\r\n<p>Projects developed in SparkFire Labs create a framework for support variable privacy and</p>\r\n<p>Multiple roles,</p>\r\n<p>Privacy Controls</p>\r\n<p>&nbsp; Open, Closed, Invisible</p>\r\n<p>Project Type</p>\r\n<p>&nbsp; Commercial, Non-profit, Hybrid, Undecided&nbsp;</p>\r\n<p>Project Home Page</p>\r\n<p>&nbsp; Post Needs / Requests</p>\r\n<p>Project organization and management</p>\r\n<p>&nbsp; Google Drive / Calendar Integration</p>\r\n<p>&nbsp; Lean Kanban-Style Project Board</p>\r\n<p>&nbsp; Tasks</p>\r\n<p>&nbsp; File sharing</p>\r\n<p>&nbsp; updates</p>\r\n<p>Resource</p>\r\n<p>&nbsp; Post Needs / Requests</p>\r\n<p>&nbsp; Team Building / Recruiting</p>\r\n<p>&nbsp; Job Posting, Direct-Invite To Other Social Networks</p>\r\n<p>&nbsp;</p>\r\n<p>Promotion:</p>\r\n<p>&nbsp; Blog</p>\r\n<p>&nbsp; Activity Updates&nbsp;</p>\r\n<p>&nbsp; Project Promotion</p>\r\n<p>&nbsp; Write-Once Project Status Updates / Promotions to Other Social &nbsp; Media Connection</p>'),
(556, 'NEED TO COMPLETE Establishing Your Account', '<p>Establishing Your Account</p>\r\n<p>&nbsp;</p>\r\n<p>SparkFire Labs members can either establish an account via an existing social media login or by manually completing the sign up form and clicking the validation link in a verification email.</p>\r\n<p>&nbsp;</p>\r\n<p>It is recommended that users signup with an existing social media account as it enables SparkFire Labs members to communicate with or invite existing contacts from other networks.</p>'),
(557, 'Create My Account', '<p>1. Create My Account:</p>\r\n<p>Complete the form and click Create My Account and a verification email will be sent to the email address. Simply click on the provided link to validate the account.</p>\r\n<p>SparkFire Labs is a network of thinkers and doers. As such, we require real names. No nom de plumes, please.</p>'),
(558, 'Making Contacts & Expanding Your Network', '<p><strong>Social Capital</strong></p>\r\n<p>Social capital is an abstract term that refers to the collection of social ties that provide access to resources, information or assistance. Social capital can help in many ways, from career advancement, someone providing&nbsp; an introduction or the ease with which a startup can gain access to investment capital.&nbsp; Social capital is an important aspect to many professional social networks, such as Linkedin. How do we get it?</p>\r\n<p>Social capital is often achieved through achievement. In addition, blogging and tweeting are common online approaches to accumulating social capital. Companies like Klout and others, attempt to rank individuals based on metrics that are believed to be expressions of social capital. Examples might include, web presence, number of tweets, number of blog subscribers and other proprietary factors that are added to their algorithm.</p>\r\n<p>While we may want to develop a large following on Twitter, it doesn&rsquo;t necessarily mean we want to receive all of our followers Tweets in return.&nbsp;</p>\r\n<p><strong>Relationships</strong></p>\r\n<p>Relationships are important and often complicated, in part, by the variety of interactions, expectations and value we place on them. How we segment our relationships often determines how we interact with someone. For example, what is appropriate to say between close friends on Facebook may not be appropriate your boss. In other words, filtering is a good thing and the ability to segment our relationships and filter what we share on SparkFire Labs is a great thing.</p>\r\n<p>The types of relationships and connections we maintain and seek often say a lot about what we want to achieve. SparkFire Labs accommodates the complications</p>\r\n<p><strong>Following</strong></p>\r\n<p>SparkFire Labs follows the same basic naming system as Twitter. Following is a uni-directional (non reciprocal) relationship in which a user finds a project or person that interests them and would like to receive continuing updates that they make available to the public.&nbsp; Updates from the projects and people you are following appear in your activity stream. Because it is not a reciprocal relationship, it''s not required for the project or person being followed to confirm a follow request.</p>\r\n<p>Following is a great way to gain access to novel ideas, discussions and people but with the side effect of receiving a lot more stuff that may not interest you (noise).</p>\r\n<p>Following a person or a project is easy. Simply visit a person&rsquo;s or a project&rsquo;s profile and click the follow link. The person or project being added as a &ldquo;follow&rdquo; will receive an email notification. To unfollow a person or project works similarly. Click on the link and select &ldquo;unfollow&rdquo;, no additional action is required and the person or project is not notified of the change of status.</p>'),
(560, 'Potential competition', '<p><span class="n_data">The <a href="http://www.kegworks.com/product.php?productid=174760&amp;cat=725&amp;page=2">Hops Holster&nbsp;Can Ammo Pack</a>($30) includes&nbsp;12 insulated holsters and each one can hold a single 12-ounce can. &nbsp;<em>"Next time you&rsquo;re tailgating, camping or attending a BYOB party you can avoid those long, thirsty walks back to the cooler or the fridge by keeping a plethora of your favorite canned beers right on your chest"</em> Awesome beer can Ammo Pack!</span></p>\r\n<p><span class="n_data">*They offer only a plain and boring style. I think there is an opportunity to produce branded sports holster (obviously we''d have to explore licensing agreements) for the use of logos.&nbsp; </span></p>\r\n<p><span class="n_data">i.e. NASCAR, Georgia Bulldogs, Texas Longhorns. <br /></span></p>\r\n<p><span class="n_data">http://www.likecool.com/Hops_Holster_12_Can_Ammo_Pack--Gadget--Gear.html</span></p>\r\n<p><span class="n_data"><br /></span></p>'),
(561, 'Beer Bandolier', '<p>Competing products from other retailers</p>'),
(562, 'Another potential competitor', '<p>These files could be anything, pdf, text, images etc.....which are uploaded to my gdrive account and for which people on my team can access if they have a google account and sign up for a free Gdrive. Cloud based storage is inexpensive and GDrive allows me to put controls on the files, such as permit editing or not, etc...</p>\r\n<p>Not sure about the category drop down menu. These need to be filled in. </p>\r\n<p>&nbsp;</p>'),
(563, 'Price and product strategy', '<p>I''ll upload an xls sheet with some assumptions we could model, but frankly we won''t know until we try selling. I suggest we make a few demos and try and sell them at a sporting event.</p>\r\n<p>I''ve already ordered a few from the largest retailers so we can take a closer look at the quality, design etc. Tags might give us some idea on who they outsourced the manufacturing to.</p>\r\n<p>As far as design. I''m wondering how a premium version in which each holder was designed with insulation and a less expensive one with simple strapping or a sewn pocket. </p>'),
(564, 'Beer Bandolier Shootout', '<p>Having received 3 bandoliers from 3 seperate retailers, the first thing that struck me was the lack of insulation or pading on the side facing the wearer. I tried both the 6 and 12 versions and the 12 left me in a state of hypothermia while watching my son''s soccer practice. Thankfully I was asked to leave early this time which prevented (I am certain) a medical emergency.</p>\r\n<p>I doubtful a strip of insulation represents a sustainable competitive advantage but it was a good product testing experience. </p>'),
(565, 'Chinese manufactured bandolier', '<p>Found this one made from China for only $13. Poor quality but inexpensive. I''m starting to have doubts about our project pricing strategy.</p>'),
(566, 'Contacts from GEM', '<p>One of my old stashes of contact lists. This is a little out of their area but this might be of use when we are seeking beta testers or investors or both.</p>\r\n<p>To view the file, you will need to download. Integrated with GDrive so pulling some of these files directly off of my Google storage account</p>\r\n<p>&nbsp;</p>'),
(567, 'Team Meeting With A Distributor', '<p>I''ve set up a meeting with Tom Jordan of Kilpatrick Distributors. Just informational but he already has an idea on what we would like to achieve.</p>'),
