(577, 'Regular Saturday Video Conference', '<p>Follow up on last weeks discussion and general update on progress. I also have a couple of demo slides I''ll share as well as share my desktop while I demo the new Beer Bandolier Website.</p>'),
(578, 'Regular Saturday Video Conference', '<p>Follow up on last weeks discussion and general update on progress. I also have a couple of demo slides I''ll share as well as share my desktop while I demo the new Beer Bandolier Website.</p>'),
(579, 'Regular Saturday Video Conference', '<p>follow up on tasks, general progress and go over the calendar for the rest of the month. I also want to show some slides and also my desktop to demo new software.</p>'),
(580, 'Thomas Edison you have been invited to join Beer Bandolier!', 'Hi Thomas Edison,\n\nchris_admin invited you to join the ''Beer Bandolier'' project as collaborator. Click below to view your invitations:\n\nhttp://keetup.mine.nu:1337/sparkfire/projects/invitations/Thomas_Edison\n\nThe user left the following message: \n\n<p>Need your help</p>'),
(581, 'Alexander Bell you have been invited to join Beer Bandolier!', 'Hi Alexander Bell,\n\nchris_admin invited you to join the ''Beer Bandolier'' project as collaborator. Click below to view your invitations:\n\nhttp://keetup.mine.nu:1337/sparkfire/projects/invitations/Alexander_Bell\n\nThe user left the following message: \n\n<p>Need your help</p>'),
(582, 'I apologize for hanging up', '<p>I had an important call from my assistant and did not have time to say goodbye. I hope to see you at the Salt Lick BBQ meeting.</p>\r\n<p>All the best,</p>\r\n<p>Alexander</p>\r\n<p>&nbsp;</p>'),
(583, 'I apologize for hanging up', '<p>I had an important call from my assistant and did not have time to say goodbye. I hope to see you at the Salt Lick BBQ meeting.</p>\r\n<p>All the best,</p>\r\n<p>Alexander</p>\r\n<p>&nbsp;</p>'),
