(614, 'What the National Additive Manufacturing Innovation Institute Is and What I Wish It Was', '<p>When President Barack Obama <a href="http://www.whitehouse.gov/the-press-office/2012/08/16/we-can-t-wait-obama-administration-announces-new-public-private-partners">announced</a> plans to create a National Network for Manufacturing Innovation (NNMI), I was probably among the many 3D printing enthusiasts in the US overjoyed by the idea.&nbsp; I love 3D printing, I&rsquo;ve invested in 3D printing and I thought that a national embrace of the technology would mean that I could have an affordable 3D printer in my home sooner, rather than later.&nbsp; After I heard about the network and the National Additive Manufacturing Innovation Institute (NAMII), the foundation created to lead the network, I put the thing in the back of my mind, content with the idea that there was a federally funded establishment out there dedicated to one of my favorite interests.</p>\r\n<p>At the same time that I am a 3D printing enthusiast, I am a <a href="http://www.youtube.com/watch?v=GS2zU6YPl24">peace enthusiast</a>, self-righteously believing that solutions to the world&rsquo;s conflicts do not need to rely on violence.&nbsp; In my own life, I&rsquo;ve found that a relatively peaceful attitude has led to my own happiness.&nbsp; When I&rsquo;m nice to those around me, those around me are usually nice back &ndash; classic golden rule stuff.&nbsp; And, being a peaceful person, disinterested in attaining wealth, fame and power, is one of the things that led me to my future wife.&nbsp; This brilliant, beautiful and hilarious fianc&eacute; of mine is in the same boat, refraining from conflict whenever possible.&nbsp; So, when I discovered who the major players were behind the foundation of and control of NAMII, I became disheartened.</p>\r\n<p>It&rsquo;s through the military that a good deal of our technology is created.&nbsp; And this is as true with additive manufacturing as it was with ARPANET, the precursor to the Internet.&nbsp; I don&rsquo;t know why I didn&rsquo;t notice it when I first heard Barack Obama&rsquo;s announcement, but the head governmental organization behind the search for companies and institutions to make up NNMI was the Department of Defense, formerly known as the War Department until 1947.&nbsp; With the DoD in charge of doling out the public&rsquo;s $30 million for 3D printing, it&rsquo;s no surprise that the organization eventually chosen to lead the new institute was the National Center for Defense Manufacturing and Machining (NCDMM), a nonprofit dedicated to creating parts for the various armed forces whose &ldquo;NCDMM Consortium initiative is designed to provide technical support and guidance to smaller manufacturing businesses across the nation so they can better support DoD supply chain requirements,&rdquo; according to the organization&rsquo;s website.&nbsp; Consequently, the directors of NAMII are also the directors of the NCDMM.&nbsp; Among other things, the NCDMM is dedicated to enhancing the production efficiency of the U.S. Army&rsquo;s missiles and munitions:</p>\r\n<blockquote>\r\n<p><a href="http://3dprintingindustry.com/wp-content/uploads/2013/02/Missile_Munitions.jpg"><img class="alignright" src="http://3dprintingindustry.com/wp-content/uploads/2013/02/Missile_Munitions.jpg" border="0" alt="Missile_Munitions" title="Missile_Munitions" width="280" height="268" /></a><em>We are able to draw on our experience and leverage our Alliance Partners and Manufacturing Consortium to help our customers meet and exceed the needs of the Army. Our innovations have increased machining productivity by 100 percent and improved processing times by 80 percent.</em></p>\r\n<p><em>Whether we&rsquo;re sustaining current missiles and munitions platforms or developing new, advanced processes, the NCDMM remains committed to furthering the advancement and implementation of new manufacturing technologies to support the warfighter.</em></p>\r\n<p><em>We are proud to have provided solutions for many missile- and munitions-based systems, including the M228 Training Grenades, M249 Machine Gun, Extended Area Protection and Survivability (EAPS), the 30mm Air Burst Projectile, and the Advanced Targeting Pod, just to name a few.</em></p>\r\n</blockquote>\r\n<p>They also play a part in the US&rsquo;s controversial drone program, which has been responsible for the deaths of between <a href="http://www.thebureauinvestigates.com/2012/01/11/obama-2012-strikes/">2,562 and 3,325 people in Pakistan, including 474-881 civilians and 176 children, according to </a><a href="http://www.thebureauinvestigates.com/2012/01/11/obama-2012-strikes/"><em>The Bureau of Investigative Journalism</em></a>.&nbsp; It&rsquo;s speculated that the drone strikes may even increase the threat of terrorism, with <a href="http://www.pewglobal.org/files/2012/06/Pew-Global-Attitudes-Project-Pakistan-Report-FINAL-Wednesday-June-27-2012.pdf">negative opinions of the US growing in Pakistan</a> and the drone attacks providing a <a href="http://www.guardian.co.uk/world/2012/jun/05/al-qaida-drone-attacks-too-broad?CMP=twt_gu">possible</a> rationale for further terrorist recruitment. To an organization such as the NCDMM, however, manufacturing the parts for drones is only a matter of business:</p>\r\n<blockquote>\r\n<p><a href="http://3dprintingindustry.com/wp-content/uploads/2013/02/UAV_global_hawk.jpg"><img class="alignright size-medium wp-image-5667" src="http://3dprintingindustry.com/wp-content/uploads/2013/02/UAV_global_hawk-300x220.jpg" border="0" alt="UAV_global_hawk" title="UAV_global_hawk" width="300" height="220" /></a><em>In recent years, the use of UAVs has escalated as a means of providing greater battlefield awareness and reducing the risk of loss of or damage to manned aircraft. As UAV usage has increased, so too has the demand for more reliable UAVs that offer longer service life between maintenance intervals.</em></p>\r\n<p><em>NCDMM assists in this ongoing effort by providing expertise in identifying alternative materials and manufacturing methods to produce replacement components that possess higher performance characteristics &mdash; often at a reduced unit cost. We also aid in the evaluation of wear characteristics, correction of failure modes, and the development of next-generation technologies for UAVs.</em></p>\r\n</blockquote>\r\n<p>From inception to execution, the NNMI has been headed up by major weapons manufacturers.&nbsp; The <a href="http://www.google.com/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=2&amp;cad=rja&amp;ved=0CEQQFjAB&amp;url=http%3A%2F%2Fwww.whitehouse.gov%2Fsites%2Fdefault%2Ffiles%2Fmicrosites%2Fostp%2Fpcast_amp_steering_committee_report_final_july_17_2012.pdf&amp;ei=7LL5UI2fKIfxigL7rIFI&amp;usg=AFQjCNGXVKPCq4n7h1WCaVBOVSVwLdMgCw&amp;sig2=E6_osEiSeN6vBGq6TRtskA&amp;bvm=bv.41248874,d.cGE">proposal</a> for what was to become the NNMI was written up by the Advanced Manufacturing Partnership (AMP) Steering Committee, a committee made up of both university presidents, such as MIT&rsquo;s Susan Hockfield, and the CEOs of the following major corporations:</p>\r\n<p>COntinue reading:</p>\r\n<p>http://3dprintingindustry.com/2013/02/18/what-the-national-additive-manufacturing-innovation-institute-is-and-what-i-wish-it-was/?utm_source=rss&amp;utm_medium=rss&amp;utm_campaign=what-the-national-additive-manufacturing-innovation-institute-is-and-what-i-wish-it-was</p>'),
