(621, 'Jobs Module components: functionality', '<div>\r\n<p>Keetup Jobs module </p>\r\n<p>http://www.keetup.com/products/read/743/jobs?lang=en</p>\r\n<p>This module incorporates a "Job Offers" section to the social network. The users of the social network would be able to apply for a job including the Resume (curriculum).</p>\r\n<div>\r\n<p>Administrator can add Job offers.</p>\r\n<p>The users can filter by category and apply for jobs (attaching a Resume).</p>\r\n<p>When an user applies for a job the administrator will receive an email.</p>\r\n<p>The administrators can see the list of users that have applied for a job.</p>\r\n</div>\r\n</div>'),
