(694, 'We need to change Project navigation terms on the left (vertical of project)', '<p>Group Meetings = Video Conference</p>\r\n<p>Project File = local Files</p>\r\n<p>Project Files = GDrive Files</p>\r\n<p>Sync Project Files = Sync Files with GDrive</p>\r\n<p>Sync Project Meetings = + Video Conference to GCal</p>\r\n<p>Events: Group (This takes me out of my project to look at all activity Feeds? or just for this project? double check. </p>'),
(695, 'Project Profile Takes Up Too Much Space. We need to remove it', '<p>Remove the big project profile in the center of the project space</p>\r\n<p>&nbsp;</p>\r\n<p>Return to this to resolve....either use a Project Home Page with profile etc...</p>\r\n<p>or hide the profile and access via a button or drop down. </p>\r\n<p>&nbsp;</p>\r\n<p>Just like with your own profile info and image, we need to move the project profile and owner image and just add a Profile button at the top.</p>\r\n<p>Alternatively, we can add a drop down box next to the project image. The current button is called <strong>Actions</strong> I think we could combine the button with a link to the Profile.</p>'),
(696, 'Change Left Side Navigation Terms', '<p>The current terms are confusing. We need to rename them for clarity.</p>'),
(697, 'Change Top (Horizontal Navigation) layout', '<p>We should make the current header (flame with SparkFire Labs etc.) static.</p>\r\n<p>We should make it a little bit wider and put our horizontal navigation accross the top on the header. This way it stays put and the page scrolls under. </p>'),
