(711, 'Change Assist to Attend', '<p>We need to change "<strong>Assist</strong>" button to "<strong>Attend</strong>"</p>\r\n<p>Change "<strong>No Assist</strong>" to "<strong>Not Attending"</strong></p>\r\n<p>&nbsp;</p>'),
